import React from "react";
import { render } from "react-dom";
import { View } from "react-native";

function Home() {
  return render(
    <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
      <Text> Home Fom Screen</Text>
    </View>
  );
}
export default Home;
